export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},nG8ZbvXraY:{data:{id:2356,attributes:{imdbId:"tt0103243",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMmY2NjQzZjUtZTMwOS00YThhLThiZDQtMzAyNWQwZGU0ZmVkXkEyXkFqcGdeQXVyNjMwMjk0MTQ@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"67%"}],item_lang:{data:{id:3019,attributes:{title:c,plot:"Around 1906, the widow Lilia Herriton (Dame Helen Mirren) meets a young man when she visits Italy and marries him. The man is only a dentist without a good name, and Lilia's relatives are clearly unhappy with her choice. Lilia dies while giving birth to a son, and two relatives travel to Italy to take care of of the baby, expecting no trouble from the father.",slug:"where-angels-fear-to-tread"}}},books:{data:[{id:11449,attributes:{title:c,description:"An impulsive English widow’s trip to Italy stirs up trouble for her uptight in-laws in this classic novel by the author of A Passage to India. Leaving dreary England behind, thirty-three-year-old widow Lilia Herriton travels to exotic Italy where she is soon engaged to a handsome, younger Italian man. Her late husband’s family is not pleased, and they try to bring Lilia home—but fail. After Lilia gives birth to a son, her in-laws once again intercede. Philip Herriton, his sister Harriet, and their friend Caroline are determined not to let the child grow up in such uncivilized surroundings. But as cultures clash in this tragicomedy of manners, their mission takes an unexpected turn or two . . . Originally published in 1905, Where Angels Fear to Tread was E. M. Forster’s first novel. It has been adapted for radio and the opera, and as a 1991 film starring Helen Mirren, Helena Bonham Carter, and Judy Davis. Forster went on to receive great acclaim for novels such as A Room with a View, Howard’s End, and A Passage to India. “A whole and mature work dominated by a fresh and commanding intelligence.” —Lionel Trilling, leading literary critic and essayist",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_AA9EAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:true,published:"2021-08-31",publisher:"Open Road Media",subtitle:a}},{id:11450,attributes:{title:"Where Angels Fear to Tread (天使裹足之處)",description:"※ Google Play 圖書不支援多媒體播放 ※",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-hQZAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:d,published:"2011-03-15",publisher:"Hyweb Technology Co. Ltd.",subtitle:a}},{id:11451,attributes:{title:c,description:"Where Angels Fear to Tread (1905) follows two women to Italy: the widowed Lilia Herriton and her traveling companion Caroline Abbott. Lilia falls passionately in love with the country, and also with a young Italian man. Her decision to remain in Italy enrages her dead husband's family, who send her brother-in-law to fetch her back.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gFtTUsl9G4AC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:d,published:"2009-01-01",publisher:"The Floating Press",subtitle:a}},{id:11452,attributes:{title:"Where Angels Fear to Tread Annotated",description:"Where Angels Fear to Tread is a novel by E. M. Forster. The title comes from a line in Alexander Pope's An Essay on Criticism: \"For fools rush in where angels fear to tread\".",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ZL4ezgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[h],firstBook:d,published:"2020-12-13",publisher:a,subtitle:a}},{id:11453,attributes:{title:c,description:"When a young English widow takes off on the grand tour and along the way marries a penniless Italian, her in-laws are not amused. That the marriage should fail and poor Lilia die tragically are only to be expected. But that Lilia should have had a baby -- and that the baby should be raised as an Italian! -- are matters requiring immediate correction by Philip Herriton, his dour sister Harriet, and their well-meaning friend Miss Abbott.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=mjL9xQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[h],firstBook:d,published:"2019-06-03",publisher:a,subtitle:"A Fantastic Story of Fiction (Annotated) By E.M. Forster."}}]}}},meta:{}}},prerenderedAt:1681377222075}}("","movie","Where Angels Fear to Tread",null,"E. M. Forster","series",1,"E M Forster"))